The scripts for reading .csv and shapefile formats into the AMS is within the tests folder. Eventually, the goal is to move these capabilities out into the user-facing API. The tests folder is located in the main repo directory here . To read in new data, you will modify the file path of the appropriate tests: From test.rs lines 48-55: fn city_addresses() -> Clean<SpatialAddresses> { let addr = address::import::GrantsPassSpatialAddresses::from_csv( // Modify the path here to match the new file location "c:/users/erose/repos/address/tests/test_data/city_addresses_20240905.csv", )?; let addr = SpatialAddresses::from(&addr[..]); addr.save("data/addresses.data")?; Ok(addr)
} From test.rs lines 84-97: fn lexis_nexis_boundary() -> Clean<Boundary> { info!("Reading city limits."); // Modify the path here to match the new file location let cl = Boundary::from_shp_z("c:/users/erose/geojson/city_limits.shp", "City Limits")?; info!("City limits successfully read."); info!("Reading public safety."); let ps = Boundary::from_shp( // Modify the path here to match the new file location "c:/users/erose/geojson/public_safety_agreement.shp", "Public Safety Agreement", )?; info!("Public safety agreements successfully read."); let ln = Boundary::new("Lexis Nexis Boundary", cl.geometry.union(&ps.geometry)); ln.save("data/lexis_nexis_boundary.data")?; Ok(ln)
} Note that these functions update two saved files within the repo: "addresses.data" and "lexis_nexis_boundary.data". These files are in a binary format that loads quickly into the AMS.
